import React , { Component } from 'react';
import Navbar  from '../../Layout/Navbar';
import Footer from '../../Layout/Footer';


class Dashboard extends Component {


  render(){
    return(
      <div className='mydash'>
        <Navbar />

        <Footer />
      </div>
    )
  }
}



export default Dashboard ;
